import {
  FaHome,
  FaUsers,
  FaStoreAlt,
  FaArchive,
  FaRegSun,
  FaSignOutAlt,
  FaBars,
} from "react-icons/fa";
import { NavLink, useNavigate } from "react-router-dom";
import logoAdmin from "@assets/images/logo-admin.png";
import { logOutAdmin } from "@apis/auth";
import { useState } from "react";

const Navbar = () => {
  const [showNavbar, setShowNavbar] = useState(false);
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      const response = await logOutAdmin();
      console.log("Logout successful:", response);
      localStorage.removeItem("token");
      localStorage.removeItem("accessToken");
      navigate("/admin/login");
    } catch (error) {
      console.error("Failed to logout:", error);
    }
  };
  const ListNav: {
    id: number;
    icon: any;
    to: string;
    title: string;
  }[] = [
    {
      id: 1,
      icon: <FaHome />,
      to: "/admin/dashboard",
      title: "Dashboard",
    },
    {
      id: 2,
      icon: <FaUsers />,
      to: "/admin/users",
      title: "Customer",
    },
    {
      id: 3,
      icon: <FaStoreAlt />,
      to: "/admin/shop",
      title: "Shop",
    },
    {
      id: 4,
      icon: <FaArchive />,
      to: "/admin/category",
      title: "Category",
    },
    {
      id: 5,
      icon: <FaRegSun />,
      to: "/admin/setting",
      title: "Setting",
    },
    {
      id: 6,
      icon: <FaSignOutAlt />,
      to: "#",
      title: "Log Out",
    },
  ];
  return (
    <>
      <div className="mobile-navbar hidden">
        <FaBars className="text-[40px] pt-1 translate-y-2 translate-x-3" />
      </div>
      <div className="navbar w-[15%] h-[100vh] bg-[#394449] shadow-2xl absolute z-50">
        <div className="logo">
          <img src={logoAdmin} alt="Logo Admin" />
        </div>
        {ListNav.map((item) =>
          item.to !== "#" ? (
            <NavLink
              to={item.to}
              key={item.id}
              className="flex p-5 gap-x-10 items-center"
            >
              <div className="items-center text-[40px]">{item.icon}</div>
              <div className="text-[20px]">{item.title}</div>
            </NavLink>
          ) : (
            <div
              key={item.id}
              className="flex p-5 gap-x-10 items-center cursor-pointer"
              onClick={handleLogout}
            >
              <div className="items-center text-[40px]">{item.icon}</div>
              <div className="text-[20px]">{item.title}</div>
            </div>
          )
        )}
      </div>
    </>
  );
};

export default Navbar;
